 @gabrielbarbosa7558  o erro não foi demitir o Renato. O erro foi contratar um pior. O Renato não botava os jovens, o novo técnico continuou não botando.

Mas o maior culpado é a direção. Por anos valorizando que não devia, contratando por muito dinheiro quem não dá retorno, e pagando salário baixo e excluindo quem tem potencial.

Vale ressaltar que muitos desses erros da direção foram pedidos do Renato, pq o Renato não era só treinador. Tinha forte influência em quem chegava e em quem saía. E acho q o técnico tem que ter mesmo essa influência. Mas no caso do Renato, foi feita com muita incompetência
